import React, { Component } from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import ParticlesBg from 'particles-bg';
import Clarifai from 'clarifai';
import FaceRecognition from './components/FaceRecognition/FaceRecognition';

class App extends Component{
  constructor(){
    super();
    this.state = {
      input:'',
      imageUrl:''
    }
  }

  onInputChange = (event) =>{
    this.setState({input: event.target.value});
  }

  onButtonSubmit = () => {
    console.log("click"); 
    this.setState({imageUrl: this.state.input});    

    // URL of image to use. Change this to your image.

    const IMAGE_URL = this.state.input;

    const raw = JSON.stringify({
      "user_app_id": {
        "user_id": "neof99",
        "app_id": "my-first-application"
      },
      "inputs": [
          {
              "data": {
                  "image": {
                      "url": IMAGE_URL
                  }
              }
          }
      ]
    });

    const requestOptions = {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Authorization': 'Key a7a76845a52d414fb9cb3e696122c8b7'
        },
        body: raw
    };

    // NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
    // https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
    // this will default to the latest version_id

    fetch("https://api.clarifai.com/v2/models/face-detection/outputs", requestOptions)
        .then(response => response.outputs[0].data.regions[0].region_info.bounding_box)
        .then(result => console.log(result))
        .catch(error => console.log('error', error));



    /*app.models.predict("6dc7e46bc9124c5c8824be4822abe105","https://samples.clarifai.com/face-det.jpg").then(
      function(response){
        console.log(response);
      },
      function(err){
        console.log(err);
      }
    );
    */




}

  render(){
    return(
      <div className="App">
        <ParticlesBg className='particles' color="#ffffff" num={300} type="cobweb" bg={true} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}  />
        <FaceRecognition imageUrl = {this.state.imageUrl} />
      </div>
    );
  }
}

export default App;
